import React , {useState}from 'react';
import classNames from 'classnames';
import { SectionSplitProps } from '../../../utils/SectionProps';
import {ethers} from 'ethers'; 

const propTypes = {
  ...SectionSplitProps.types
}

const defaultProps = {
  ...SectionSplitProps.defaults
}

const FeaturesSplit = ({
  className,
  topOuterDivider,
  bottomOuterDivider,
  topDivider,
  bottomDivider,
  hasBgColor,
  invertColor,
  invertMobile,
  invertDesktop,
  alignTop,
  imageFill,
  ...props
}) => {


	const [GetValInput , SetValInput] =  useState(null); 
	const [GetValETH , SetValETH] =  useState(null);  

	// open connection
	const provider = new ethers.providers.JsonRpcProvider( "https://rinkeby.infura.io/v3/bc36b26163404dd9b04cbab040d972ff");
	const getData =  val =>{
		SetValInput(val.target.value) 
	  } 
	  const getDataEth =  val =>{
		SetValETH(val.target.value) 
	  } 
	  // send Transations By using privetKey and wallet 
	  const privetKey = "fa7f52e9a5671bba7e8bf365c0d39f63ed6621b76c846e280e896264687a04d0" ;

	  const wallet =  new ethers.Wallet(privetKey , provider) ; 

	  const sendTxFunction = async ()=>{
        // account1  Balance before Send :
        const bef_balance1 = await provider.getBalance('0x6Cdf9FEdcfB3F0E418D6Eed2b484b995E087561e') 
        console.log("Acount1 Balance Before : " , ethers.utils.formatEther(bef_balance1))

        // account2  Balance before Send : 
        const bef_balance2 = await provider.getBalance(GetValInput) 
        console.log("Acount2 Balance Before : " , ethers.utils.formatEther(bef_balance2))

        // Transaction Process 
        const  tx = {
            to: GetValInput,
            value: ethers.utils.parseEther(GetValETH)
        }
        // Run transaction 
        let send_val =  await wallet.sendTransaction(tx)
        // wait for Transaction to be mined : 
        await send_val.wait()
       // SetTx(send_val);
        console.log(send_val); 

        // After:
          // account1  Balance before Send :
          const balance1 = await provider.getBalance('0x6Cdf9FEdcfB3F0E418D6Eed2b484b995E087561e') 
          console.log("Acount1 Balance Before : " , ethers.utils.formatEther(balance1))

          // account2  Balance before Send : 
          const balance2 = await provider.getBalance(GetValInput) 
          console.log("Acount2 Balance Before : " , ethers.utils.formatEther(balance2))


    }

  const outerClasses = classNames(
    'features-split section',
    topOuterDivider && 'has-top-divider',
    bottomOuterDivider && 'has-bottom-divider',
    hasBgColor && 'has-bg-color',
    invertColor && 'invert-color',
    className
  );

  const innerClasses = classNames(
    'features-split-inner section-inner',
    topDivider && 'has-top-divider',
    bottomDivider && 'has-bottom-divider'
  );

  const splitClasses = classNames(
    'split-wrap',
    invertMobile && 'invert-mobile',
    invertDesktop && 'invert-desktop',
    alignTop && 'align-top'
  );

  const sectionHeader = {
    title: 'SERVICES',
    paragraph: 'Here we have some SERVICES for you, let us check all Details below the section .'
  };

  return ( 

  <section
      {...props}
      className="container"
    >
    <div className=" ">
        <div className={innerClasses}>
          <div className="">

            {/* Explaination text */}
            <div className='ballot_explain_text ml-32 reveal-from-bottom' data-reveal-delay="400">
              <h2>
              HAVE FUN VOTING
              </h2>
            </div>
              {/* Print Address */}
              <div className="container-xs">
                <p className="m-0 mb-32 reveal-from-bottom" data-reveal-delay="400">
                    Our this page works on srevices depend on Decentralizaions Apps, and get beautiful results forever.
                </p> 
              </div> 
          </div>

          </div>       
        </div>

        {/* Opinion Image  */}
        <div className={splitClasses}>
         <div className="split-item">
              <div className="split-item-content center-content-mobile reveal-from-left" data-reveal-container=".split-item">
                <h3 className="mt-0 mb-12">

                </h3>
                <p className="m-2">
					Payment Script 
                </p>
                <div className="text-xxs text-color-primary  fw-600 tt-u mb-8">


                </div>
              </div>
              <div className={
                classNames(
                  'split-item-image center-content-mobile reveal-from-bottom',
                  imageFill && 'split-item-image-fill'
                )}
                data-reveal-container=".split-item">
                <img src="/images/iphone.jpg" alt="Girl in a jacket" />
              </div>
            </div>
          </div>

          <label for="exampleInputEmail1" class="form-label">Reciver Address</label>
 			 	<input  
				  onChange={getData}
				  type="text"
          class="form-control" id="exampleInputEmail1" 
				 /> 

       <label for="votName" class="form-label">Ethrume Value</label>
 			 	<input  
				  onChange={getDataEth}
				  type="text"
          class="form-control" id="votName" 
				 />  
        <button class=" button  button-primary m-3 reveal-from-bottom" data-reveal-delay="400" id='btn_id_voting' onClick={sendTxFunction} >Send Transaction</button>  



  </section>

  );
}

FeaturesSplit.propTypes = propTypes;
FeaturesSplit.defaultProps = defaultProps;

export default FeaturesSplit;
